func transcode(toTranscode: Resource<SVG>) -> Resource<Drawable> {
    let svg = toTranscode.get()
    let picture = svg.renderToPicture()
    let drawable = PictureDrawable(picture: picture)

    let returnedBitmap = Bitmap.createBitmap(width: drawable.intrinsicWidth,
                                             height: drawable.intrinsicHeight,
                                             config: .ARGB_8888)
    let canvas = Canvas(bitmap: returnedBitmap)
    canvas.drawPicture(drawable.picture)
    let d = BitmapDrawable(resources: context.resources, bitmap: returnedBitmap)

    return SimpleResource(d)
}
